import React from 'react';
import ReactDOM from 'react-dom';
import M from 'materialize-css';
import './index.css';

class Button extends React.Component {
    render() {
        return (
            <div class="row center-align s1">
                <a class="waves-effect waves-light btn-large">Buy / Sell / Provide Liq</a>
            </div>
        );
    }
}

class InputField extends React.Component {
    render() {
        return (
            <div class="row">
                <div class="col s12">This div is 12-columns wide on all screen sizes</div>
                <div class="col s9">6-columns (one-half)</div>
                <div class="col s3">6-columns (one-half)</div>
            </div>
        );
    }
}

class Tab extends React.Component {
    render() {
        return (
            <div>
                <li class="tab col s4"><a href="#test1">{this.props.name}</a></li>
            </div>
        );
    }
}

class Container extends React.Component {
    render() {
        return (
            <div class="row div z-depth-5">
                <div class="col s12">
                    <ul class="tabs">
                        <Tab name="Buy" />
                        <Tab name="Sell" />
                        <Tab name="Pool" />
                    </ul>
                    <div class="hr" />
                </div>
                <div class="marpad">
                    <InputField />
                    <InputField />
                </div>
                <div>
                    <Button />
                </div>
            </div>
        );
    }
}

class NavBar extends React.Component {
    render() {
        return (
            <div>
                <nav>
                    <div class="nav-wrapper pink lighten-3">
                        <a href="#" class="brand-logo center">MatejSwap</a>
                        <ul id="nav-mobile" class="right hide-on-med-and-down">
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }
}

class Page extends React.Component {
    render() {
        return (
            <div>
                <NavBar />
                <Container />
            </div>
        );
    }
}

ReactDOM.render(<Page />, document.getElementById("root"));
